import styled from 'styled-components';

const Box = styled.div`
    width: 500px;
    height: 500px;
    border: 1px solid red;
`;

const IptGroup = styled.dic`
    width: 100%;
`;

const Box2 = (props) => {
    return (
        <Box>
            <div>
                <label>아이디</label>
                <input></input>
            </div>
            <div>
                <label>비밀번호</label>
                <input></input>
            </div>
            <button>로그인</button>
        </Box>
    );
};

export default Box2;
